(2915, 0, 'newsletter', 'a:15:{s:14:"noconfirmation";s:1:"1";s:17:"subscription_text";s:206:"<p>Subscribe to my newsletter by filling the form below. I''ll try to make you happy.</p>\r\n<p>A confirmation email will be sent to your mailbox: please read the instructions to complete the subscription.</p>";s:15:"subscribed_text";s:245:"<p>You successfully subscribed to my newsletter. You''ll receive in few minutes a confirmation email. Follow the link in it to confirm the subscription. If the email takes more than 15 minutes to appear in your mailbox, check the spam folder.</p>";s:20:"confirmation_subject";s:45:"Confirm now your subscription to {blog_title}";s:20:"confirmation_message";s:403:"<p>Hi {name},</p>\r\n<p>I received a subscription request for this email address. You can confirm it <a href="http://127.0.0.1/sassy_willa/{subscription_confirm_url}"><strong>clicking here</strong></a>. If you cannot click the link, use the following link:</p>\r\n<p>{subscription_confirm_url}</p>\r\n<p>If this subscription request has not been made from you, just ignore this message.</p>\r\n<p>Thank you.</p>";s:14:"confirmed_text";s:62:"<p>Your subscription has been confirmed! Thank you {name}!</p>";s:13:"confirmed_url";s:0:"";s:18:"confirmed_tracking";s:0:"";s:17:"confirmed_subject";s:22:"Welcome aboard, {name}";s:17:"confirmed_message";s:333:"<p>The message confirm your subscription to {blog_title} newsletter.</p>\r\n<p>Thank you!</p>\r\n<p>If you want to cancel your unsubscription, <a href="http://127.0.0.1/sassy_willa/{unsubscription_url}">click here</a>, if you want to change your subscription data, <a href="http://127.0.0.1/sassy_willa/{profile_url}">click here</a>.</p>";s:19:"unsubscription_text";s:146:"<p>Please confirm you want to unsubscribe my newsletter <a href="http://127.0.0.1/sassy_willa/{unsubscription_confirm_url}">clicking here</a>.</p>";s:17:"unsubscribed_text";s:64:"<p>That make me cry, but I have removed your subscription...</p>";s:20:"unsubscribed_subject";s:15:"Goodbye, {name}";s:20:"unsubscribed_message";s:92:"<p>The message confirm your unsubscription to {blog_title} newsletter.</p>\r\n<p>Good bye!</p>";s:8:"novisual";s:1:"0";}', 'no'),
(2916, 0, 'newsletter_profile', 'a:17:{s:12:"profile_text";s:115:"{profile_form}<p>If you want to cancel your subscription, <a href="{unsubscription_confirm_url}">click here</a></p>";s:5:"email";s:5:"Email";s:11:"email_error";s:40:"Your email seems wrong, check it please.";s:11:"name_status";i:1;s:4:"name";s:4:"Name";s:10:"name_error";s:25:"Your name cannot be empty";s:7:"surname";s:9:"Last Name";s:14:"surname_status";i:0;s:10:"sex_status";i:0;s:3:"sex";s:3:"I''m";s:8:"sex_male";s:4:"Male";s:10:"sex_female";s:6:"Female";s:14:"privacy_status";i:0;s:7:"privacy";s:47:"Subscribing you accept the privacy informative.";s:13:"privacy_error";s:53:"You must accept the privacy informative to subscribe.";s:9:"subscribe";s:14:"Subscribe now!";s:4:"save";s:4:"Save";}', 'no'),
