(40, 1, '2012-05-23 05:04:47', '2012-05-23 05:04:47', '[woocommerce_cart]\n\n<div class="guarantee">\n<br style="clear:both" />\n<p class="our-guarantee">Our Guarantee</p>\n<div class="col_three float_left no_margin_left">\n\n<strong>Secure online payment</strong>\nThe payment process is protected by industry standard encryption so that we can guarantee that no one can intercept your credit card details. You are fully protected while buying on line at Birdsnest. Our online merchant is Westpac and our payment gateway is E-Way.\n\n</div>\n<div class="col_three float_left">\n\n<strong>No hassle returns policy</strong>\nWe pride ourselves on a no hassle returns policy. It if doesn''t fit or suit - please return the item within 100 days for a full refund, credit or exchange.\n\n<span class="question">Any questions please call us on 1300 696378 or e-mail on service@sdfg.com.au</span>\n\n</div>\n<div class="col_three float_left no_margin_right">\n\n<strong>Fast Delivery</strong>\nWe deliver our orders to you via Australia Post. If orders are received before 1pm EST on a business day we aim to have the order to you within 2 working days. All Australian parcels are sent via express post at a flat rate within Australia of $10.95.\n\n</div>\n<!--clear-->\n</div>', 'Cart', '', 'inherit', 'open', 'open', '', '5-autosave', '', '', '2012-05-23 05:04:47', '2012-05-23 05:04:47', '', 5, 'http://127.0.0.1/sassy_willa/5-autosave/', 0, 'revision', '', 0),
